description:
Movie Info: Gunde Jaari Gallanthayyinde is a 2013 Telugu film written by Harshavardan (actor) directed by Vijay Kumar Konda. The film was produced by N. Nikitha Reddy and presented by Vikram Gowd under Sresht Movies banner. The film features Nitin, Isha Talwar and Nithya Menen in the lead role. Indian badminton player Jwala Gutta is making her debut in a special appearance with this film. Cinematography for the film was handled by I.Andrew and the music was composed by Anoop Rubens. The title of this movie is taken from a song from Pawan Kalyan's Gabbar Singh. The film was declared Successful at the Box office, emerging as Nitin's consecutive hit after Ishq, also starring Nithya Menen.

